import React, { useEffect, useState } from 'react';
import axios from 'axios';

function DoadorList() {
  const [doadores, setDoadores] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8080/doadores')
      .then(response => {
        setDoadores(response.data);
      })
      .catch(error => console.error('Erro ao buscar doadores:', error));
  }, []);

  return (
    <div>
      <h1>Doadores</h1>
      <ul>
        {doadores.map(doador => (
          <li key={doador.cpf}>{doador.nome} - {doador.tipoSanguineo}</li>
        ))}
      </ul>
    </div>
  );
}

export default DoadorList;
